import React, { useEffect, useRef } from 'react';

const VideoPlayer = ({ videoId }) => {
    const playerRef = useRef(null);

    
    return (
        <div>
            <div ref={playerRef}></div>
        </div>
    );
};

export default VideoPlayer;
